import {GET_DATA ,FETCH_PRODUCTS_PENDING, FETCH_PRODUCTS_SUCCESS, FETCH_PRODUCTS_ERROR} from './../actions/types';


import { combineReducers } from 'redux'
import {fetchData} from './fetchProducts'

export default combineReducers({
    fetchData,
})
